import React from 'react';
import { Form, Input, Layout, Button, Row, message } from 'antd';
import axios from 'axios';

const PrincipalAdmin = () => {

  const onFinish = async (values) => {
    try {
      const response = await axios.post('http://localhost:8000/Siniestros/RegistrarSiniestro', values);
      console.log(response.data); // Manejar la respuesta del backend
      message.success('Registro exitoso');
    } catch (error) {
      message.error(error.response?.data?.error || 'Error en el registro');
    }
  };

  return (
    <div style={{ backgroundColor: '#01AD94', minHeight: '100vh', position: 'relative' }}>
      <div className="circle-background" style={{ position: 'absolute', marginTop: '180px', marginLeft: '30px', width: '200px', height: '200px', borderRadius: '50%', backgroundColor: '#fff' }}></div>
      <Row justify="center" align="middle" style={{ flexGrow: 1, padding: '35px', textAlign: 'center', minHeight: 'calc(100vh - 64px)' }}>
        <Form
          name="basic"
          initialValues={{ remember: true }}
          layout="vertical"
          style={{ padding: '8px', borderRadius: '20px'}}
          onFinish={onFinish}
        >
          <img src="https://cdn-icons-png.freepik.com/512/9835/9835777.png" alt="Icono Register" style={{ marginBottom: '20px', maxHeight: '130px', textShadow: 'black' }} />
          <div style={{ borderRadius: '10px', padding: '30px' }}>
            <Form.Item
              label={<span style={{ fontSize: '15px'}}>Numero de siniestro</span>}
              name="Numero_Siniestro"
              rules={[{ required: true, message: 'Ingrese el correo electrónico!' }]}
            >
              <Input />
            </Form.Item>
            <Form.Item
              label={<span style={{ fontSize: '15px'}}>Folio Edua</span>}
              name="Folio_Edua"
              rules={[{ required: true, message: 'Por favor ingrese el folio EDUA' }]}
            >
              <Input />
            </Form.Item>
            <Form.Item>
              <Button className="BtnLogin" type="primary" htmlType="submit" style={{ backgroundColor: '#35DC21', borderColor: '#35DC21' }}>
                Registrar
              </Button>
            </Form.Item>
          </div>
        </Form>
      </Row>
      <Layout>
        <Layout.Footer style={{ backgroundColor: '#2B5C55', textAlign: 'center' }}>
          <p className="TextFooter" style={{ color: '#fff', margin: '0' }}>Cesvi Mexico ©</p>
        </Layout.Footer>
      </Layout>
    </div>
  );
};

export default PrincipalAdmin;
